import { SearchBox } from '@fluentui/react/lib/SearchBox';
import { Stack, IStackTokens } from '@fluentui/react/lib/Stack';


function header() {
  const headerstyle = {
    backgroundColor: "#2278D4",
    color: "#fff",
    padding:"16px",
    margin:"0px"
  }
  const stackTokens = { childrenGap: 10 };
  return (
    <div className="header" >
      <i class="ms-Icon ms-font-l ms-Icon--WaffleOffice365 "></i>
      <span><b>Outlook</b></span>
      <input type="search"/>
      <i class="ms-Icon ms-font-l ms-Icon--Video "></i>Meet Now
      <ul>
        <li><i class="ms-Icon ms-font-l ms-Icon--OneNoteLogo "></i></li>
        <li><i class="ms-Icon ms-font-l ms-Icon--EventToDoLogo "></i></li>
        <li><i class="ms-Icon ms-font-l ms-Icon--Ringer "></i></li>
        <li><i class="ms-Icon ms-font-l ms-Icon--Settings "></i></li>
        <li><i class="ms-Icon ms-font-l ms-Icon--Help "></i></li>
        <li><i className="fas fa-megaphone" ></i></li>
      </ul>
    </div>
  )
}

export default header
